function validate_code(n){var t={code:n};$.ajax({type:"GET",url:"/Home/ValidateCode",data:t,success:function(t){t.length>0?(location.href=t[0].fullname==undefined||t[0].fullname==null?goto_profile_page+"?code="+n:goto_event_page+"?code="+n,localStorage.setItem("x",t[0].id),localStorage.setItem("y",t[0].code)):($(".txtVerification").val(""),$(".txtVerification").focus())},error:function(n,t,i){console.log("Result: "+t+" "+i+" "+n.status+" "+n.statusText)}})}$(function(){$("#btn-verify").click(function(){validate_code($(".txtVerification").val())})});